import './inc.css';

const Inc = () =>{
    return(
        <>
            <div className="inc">
                <div className="card">
                    <h1>Increment</h1>
                    <div className="btn">
                        <button>Incre</button>
                        <button>Decre</button>
                    </div>
                </div>
            </div>
        </>
    );
};
export default Inc;
